import React from "react";


// Faça um fetch (POST) para a API abaixo
// Para a criação ser aceita é necessário enviar dodos de:
// nome, email, senha, cep, rua, numero, bairro, cidade e estado

// Essa é a função utilizado para realizar o POST
fetch('https://ranekapi.origamid.dev/json/api/usuario', {
  method: 'POST',
  headers: {
    'Content-Type': 'application/json',
  },
  // form é o objeto com os dados do formulário
  body: JSON.stringify(form),
});

// Mostre uma mensagem na tela, caso a resposta da API seja positiva


function App() {

  return (
    <form>
      <label htmlFor="nome">Nome:
        <input type="text" name="" id="nome" />
      </label>

      <label htmlFor="email">Email:
        <input type="email" name="" id="email" />
      </label>

      <label htmlFor="password">Senha:
        <input type="password" name="" id="password" />
      </label>

      <label htmlFor="cep">Cep:
        <input type="text" name="" id="cep" />
      </label>

      <label htmlFor="rua">Rua:
        <input type="text" name="" id="rua" />
      </label>

      <label htmlFor="numero">Numero:
        <input type="text" name="" id="numero" />
      </label>

      <label htmlFor="bairro">Bairro:
        <input type="text" name="" id="bairro" />
      </label>

      <label htmlFor="cidade">Cidade:
        <input type="text" name="" id="cidade" />
      </label>

      <label htmlFor="estado">Estado:
        <input type="text" name="" id="estado" />
      </label>


      <button type="submit">Enviar</button>
    </form>
  );
}

export default App;
